import React from "react";
import CrecheSlider from "./CrecheSlider";
import { AiOutlinePlusSquare } from 'react-icons/ai';




const GstCreches = () => { 
    return (   
       
        <div className="max-w-[800px] mt-[5] w-full h-screen mx-auto text-center flex flex-col justify-center text-[#0B0C38]">
             
              <h1 className=" md:text-7xl sm:text-6xl text-4xl font-bold md:py-6 font-concert ">
              Gestion des Creches
              </h1>
             
                <CrecheSlider/>

               
              
                <p className="md:text-2xl text-xl font-bold text-[#5B112B]"> Vous pouvez ajoutez votre creche en appuyant sur ce button : </p>
           
                <div className="bg-transparent   flex justify-center items-center my-3 rounded-lg ">
          
                <button className="bg-[#FB9B90]  rounded-md font-bold my-6 px-5 py-2 text-[#191A43] border-5  border-[#ED6361] hover:scale-110 duration-300">
                < AiOutlinePlusSquare size={40} className='color:#5B112B  cursor-pointer mx-auto'    />
                  </button>
                  </div> 
             
        </div>
    
    )
}

export default GstCreches;
